import React from 'react';
import logo from './logo.svg';
import './App.css';
import {ReactComponent as Icon} from './Components/Atoms/Icon/icon.svg'
import TypoIcon from './Components/Atoms/Typography';
import Tag from './Components/Atoms/tag';
import styled from 'styled-components';

const AppDiv=styled.div`
box-sizing: border-box;



display: flex;
flex-direction: row;
align-items: center;
padding: 32px;
gap: 12px;
isolation: isolate;

position: absolute;
width: 340px;
height: 259px;
left: 278px;
top: 143px;



background: #201F24;


border: 1px solid #28272B;
border-radius: 12px;`

function App() {
  return (
    <AppDiv>
      <Icon ></Icon>
      <TypoIcon></TypoIcon>
      <Tag></Tag>
    </AppDiv>
  );
}

export default App;
